loader.addFinishHandler(function() {
	GM_log("louTweak - defining overlayObject");

	qx.Class.define("louTweak.overlayObject", {
		extend: webfrontend.vis.Entity,
		statics: {
			img: {
/* remove marker */	"0": "data:image/png;base64,",
/* woodcutter */	"47": "data:image/png;base64,",
/* quarry */		"48": "data:image/png;base64,",
/* farm */			"50": "data:image/png;base64,",
/* cottage */		"4": "data:image/png;base64,",
/* marketplace */	"5": "data:image/png;base64,",
/* iron mine */		"49": "data:image/png;base64,",
/* sawmill */		"7": "data:image/png;base64,",
/* mill */			"8": "data:image/png;base64,",
/* hideout */		"9": "data:image/png;base64,",
/* stonemason */	"10": "data:image/png;base64,",
/* foundry */		"11": "data:image/png;base64,",
/* town house */	"13": "data:image/png;base64,",
/* barracks */		"14": "data:image/png;base64,",
/* city guard house */"15": "data:image/png;base64,",
/* training ground */"16": "data:image/png;base64,",
/* stable */		"17": "data:image/png;base64,",
/* workshop */		"18": "data:image/png;base64,",
/* shipyard */		"19": "data:image/png;base64,",
/* warehouse */		"20": "data:image/png;base64,",
/* castle */		"21": "data:image/png;base64,",
/* harbor */		"22": "data:image/png;base64,",
/* moonglow tower */"36": "data:image/png;base64,",
/* trinsic temple */"37": "data:image/png;base64,",
/* background */	"bg": "data:image/png;base64,",
/* exclam mark */	"-1": "data:image/png;base64,"
			}
		},
		construct: function (vis, x, y, img_id) {
			webfrontend.vis.Entity.call(this);
			this.drawNode = new webfrontend.draw.ImageNode.create(vis.scene, x+4, y+4, 50, 50, this.self(arguments).img[img_id]);
			this.drawNode.setSortOrder(100000);
			this.backgroundNode = new webfrontend.draw.BackgroundTextNode(vis.scene, x, y, 58, 58, this.self(arguments).img["bg"], "");
			this.backgroundNode.setSortOrder(99999);
		},
		destruct: function() {
			if (this.drawNode) {
				this.drawNode.release();
				this.drawNode = null;
			}
			this._disposeObjects("backgroundNode");
		},
		members: {
			drawNode: null,
			backgroundNode: null
		}
	});

});